import React from 'react';
import './App.css';
import Cars from './Cars';
import myContext from './myContext';

function App() {
  const initialState = {
    cars: {
      red: false,
      blue: false,
      yellow: false,
    },
  };

  return (
    <myContext.Provider value={initialState}>
      <Cars />
    </myContext.Provider>
  );
}

export default App;
